import React from 'react';

const Content = () => {
    return (
        <div className="content--main">
            <iframe width="560" height="315" src="https://www.youtube-nocookie.com/embed/qIOUIid_-ks" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
    )
}

export default Content;
